import React from 'react';
import {Link} from 'react-router-dom';
import video from '../../assets/video.mp4';
import {Container, AppBar, Toolbar,Box , Button} from '@mui/material'
import { useHistory } from 'react-router-dom';
import IconButton from '@mui/material/IconButton';
import HomeRoundedIcon from '@mui/icons-material/HomeRounded';
import useStyles from './styles';

const Home = ()=>{
  const classes = useStyles();
  const navigate  = useHistory();
  return (
    <Box  sx={{ flexGrow: 1 }}>
    <AppBar style={{backgroundColor:'crimson'}} position="static">
    
      <Toolbar className={classes.toolbar}>
      <IconButton
          size="large"
          edge="false"
          color="inherit"
          aria-label="menu"
          sx={{ mr: 2 }}
          onClick={()=>{
            navigate.push('/');
          }}
          className={classes.home}
        >
          <HomeRoundedIcon />
        </IconButton>
        <Button style={{marginLeft: '250px', textDecoration: 'underline'}} component={Link} color="inherit" > Blood Bank?</Button>
        <Button style={{marginLeft: '250px', textDecoration: 'underline'}} component={Link}  color="inherit" >Donor or Needy?</Button>
        </Toolbar>
    </AppBar>
    <Container style={{marginRight: '220px'}}>
    <video src={video} width="100%" height="auto" controls  />
    </Container>
  </Box>
  )
}

export default Home;
